let example = ["Cute", "Awesome", "Beautiful", "Stanning", "Brave"];

textSequence(0);
function textSequence(i) {
  if (example.length > i) {
    setTimeout(function () {
      document.getElementById("preloader").innerHTML = example[i];
      textSequence(++i);
    }, 200);
  } else if (example.length == i) {
    textSequence(0);
  }
}
function preLoader() {
  setTimeout(() => {
    $("#preloaderBox").addClass("hide_preloder");
    $(".scale_box").css("transform", "scale(1)");
  }, 100);
}
preLoader();

$(document).ready(function () {
  console.log("run ");
  const myImage = new Image();
  myImage.src =
    "data:image/jpeg;base64,";

  myImage.addEventListener("load", () => {
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");

    canvas.height = 450;
    canvas.width = 350;
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    let particalArray = [];
    const numberOfParticles = 5000;

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++) {
      let row = [];
      for (let x = 0; x < canvas.width; x++) {
        const red = pixels.data[y * 4 * pixels.width + x * 4];
        const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
        const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
        const britghness = calculateBritenessOfPixel(red, green, blue);

        const cell = [
          (cellBritghtness = britghness),
          (cellColor = `rgb(${red},${green},${blue})`),
        ];

        row.push(cell);
      }

      mappedImage.push(row);
    }

    function calculateBritenessOfPixel(red, green, blue) {
      return (
        Math.sqrt(
          red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
        ) / 100
      );
    }
    class Particles {
      constructor() {
        this.x = Math.random() * canvas.width;
        this.y = 0;
        this.speed = 0;
        this.velocity = Math.random() * 0.5;
        this.size = Math.random() * 1.5 + 1;
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);
      }

      update() {
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);
        this.speed = mappedImage[this.position1][this.position2][0];
        let movement = 2.5 - this.speed + this.velocity;

        this.y += movement;
        if (this.y >= canvas.height) {
          this.y = 0;
          this.x = Math.random() * canvas.width;
        }
      }
      draw() {
        ctx.beginPath();
        ctx.fillStyle = mappedImage[this.position1][this.position2][1];
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
      }
    }

    function init() {
      for (let i = 0; i < numberOfParticles; i++) {
        particalArray.push(new Particles());
      }
    }
    init();

    function animate() {
      // ctx.drawImage(myImage,0,0,canvas.width,canvas.height);
      ctx.globalAlpha = 0.05;
      ctx.fillStyle = "rgb(0,0,0)";
      ctx.fillRect(0, 0, canvas.width, canvas.height);
      ctx.globalAlpha = 0.2;
      for (let i = 0; i < particalArray.length; i++) {
        particalArray[i].update();
        ctx.globalAlpha = particalArray[i].speed * 0.2;
        particalArray[i].draw();
      }
      requestAnimationFrame(animate);
    }
    animate();
  });

  const canvasTwo = document.getElementById("canvas2");
  const ctxTwo = canvasTwo.getContext("2d");
  canvasTwo.width = 350;
  canvasTwo.height = 200;

  class PracticlesTwo {
    constructor(effect, x, y, color) {
      this.effect = effect;
      this.x = Math.random() * this.effect.canvasWidth;
      this.y = this.effect.canvasHeight;
      this.color = color;
      this.originX = x;
      this.originY = y;
      this.size = this.effect.gap;
      this.dx = 0;
      this.dy = 0;
      this.vx = 0;
      this.vy = 0;
      this.force = 0;
      this.angle = 0;
      this.distance = 0;
      this.friction = Math.random() * 0.6 + 0.15;
      this.ease = Math.random() * 0.1 + 0.0008;
    }
    draw() {
      this.effect.context.fillStyle = this.color;
      this.effect.context.fillRect(this.x, this.y, this.size, this.size);
    }
    update() {
      this.x += (this.originX - this.x) * this.ease;
      this.y += (this.originY - this.y) * this.ease;

      if (this.effect.mouse.x > 0) {
        this.dx = this.effect.mouse.x - this.x;
        this.dy = this.effect.mouse.y - this.y;
        this.distance = this.dx * this.dx + this.dy * this.dy;
        this.force = -this.effect.mouse.radius / this.distance;
        if (this.distance < this.effect.mouse.radius) {
          this.angle = Math.atan2(this.dy, this.dx);
          this.vx += this.force * Math.cos(this.angle);
          this.vy += this.force * Math.sin(this.angle);
        }
        this.x +=
          (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
        this.y +=
          (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
      }
    }
  }

  class Effect {
    constructor(context, canvasWidth, canvasHeight) {
      this.context = context;
      this.canvasWidth = canvasWidth;
      this.canvasHeight = canvasHeight;
      this.textX = canvasTwo.width / 2;
      this.textY = canvasTwo.height / 2;
      this.fontSize = 30;
      this.lineHeight = this.fontSize + 2;

      // particle
      this.particle = [];
      this.gap = 1;
      this.mouse = {
        radius: 20000,
        x: 0,
        y: 0,
      };
      window.addEventListener("mousemove", (e) => {
        this.mouse.x = e.x;
        this.mouse.y = e.y;
      });
    }
    wrapText(text) {
      const gradiant = this.context.createLinearGradient(
        0,
        0,
        canvasTwo.width,
        canvasTwo.height
      );
      gradiant.addColorStop(0.3, "red");
      gradiant.addColorStop(0.5, "purple");
      gradiant.addColorStop(0.7, "purple");
      this.context.fillStyle = gradiant;
      this.context.strokeStyle = "rgba(255, 255, 255, 0.2)";
      this.context.lineWidth = 0;
      this.context.letterSpacing = "4px";
      this.context.font = `${this.fontSize}px Playball`;
      this.context.textAlign = "center";
      this.context.textBaseline = "middle";
      // this.context.fillText(text, this.textX, this.textY)
      // this.context.strokeText(text, this.textX, this.textY)

      // breke multiLine
      let lineArray = [];
      let lineCounter = 0;
      let line = "";
      let word = text.split("\n");
      for (let i = 0; i < word.length; i++) {
        var textLine = line + word[i] + "";
        // console.log(this.context.measureText(textLine).width)
        this.context.fillText(
          textLine,
          canvasTwo.width / 2,
          canvasTwo.height / 2 + i * this.lineHeight
        );
        this.context.strokeText(
          textLine,
          canvasTwo.width / 2,
          canvasTwo.height / 2 + i * this.lineHeight
        );
      }
      this.convertToPartcle();
    }
    convertToPartcle() {
      this.particles = [];
      const pixels = this.context.getImageData(
        0,
        0,
        this.canvasWidth,
        this.canvasHeight
      ).data;
      this.context.clearRect(0, 0, this.canvasWidth, this.canvasHeight);
      for (let y = 0; y < this.canvasHeight; y += this.gap) {
        for (let x = 0; x < this.canvasWidth; x += this.gap) {
          const index = (y * this.canvasWidth + x) * 4;
          const alpha = pixels[index + 3];
          if (alpha > 0) {
            const red = pixels[index];
            const green = pixels[index + 1];
            const blue = pixels[index + 2];
            const color = `rgb(${red},${green},${blue})`;
            this.particles.push(new PracticlesTwo(this, x, y, color));
          }
        }
      }
    }
    render() {
      this.particles.forEach((particle) => {
        particle.update();
        particle.draw();
      });
    }
  }

  const effect = new Effect(ctxTwo, canvasTwo.width, canvasTwo.height);
  effect.wrapText("Happy Valentine's Day\nRiya");
  effect.render();
  function animateTwo() {
    ctxTwo.clearRect(0, 0, canvasTwo.width, canvasTwo.height);
    effect.render();
    requestAnimationFrame(animateTwo);
    // console.log("Anie")
  }

  animateTwo();
  // pop up
  $(".footer_button").click(() => {
    $(".pop_up").addClass("show");
  });
  $(".pop_up_button").click(() => {
    $(".pop_up").removeClass("show");
  });
});
